import React from 'react'

import Brightness5Icon from '@material-ui/icons/Brightness5'

const weatherIcon = <Brightness5Icon/>

const WeatherTemperature = ({temperature, weatherState}) => (
    <div>
        {weatherIcon}
        <span>
            {`${temperature} c°`}
        </span>
    </div>
)
export default WeatherTemperature
